import { Navigate } from "react-router-dom";

function ProctectedRoutes() {
  if (localStorage.getItem("token")) {
    console.log("if condition")
    return Navigate("/");
  }else{
    console.log("else part")
    return Navigate("/login");
  }

}

export default ProctectedRoutes;
